import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../../App.css';
import info3 from '../../images/info_3.png';

function Delete() {
  return (
    <div className="App bg-green">
        <h2>ADVERTENCIA</h2>
      <header className="App-header">
        Â¿Seguro que quiere eliminar este registro?
        <img src={info3} alt="Imagen 1" className="img-fluid mx-5 image-width" />
        <div className='row'>
        <button type="submit" className="btn btn-success mt-5 fs-3 col-md-4">Confirmar</button>
        <button type="submit" className="btn btn-success mt-5 fs-3 col-md-4">Cancelar</button>
        </div>
      </header>
    </div>
  );
}

export default Delete;
